import logo from './logo.svg';
import './App.css';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <
        img src = { logo }
        className = "App-logo"
        alt = "logo" / >
        <
        p >
        Visit < code > GigaFix < /code>. <
        /p> <
        a className = "App-link"
        href = "https://GigaFix.nl/"
        target = "_blank"
        rel = "noopener noreferrer" >
        GigaFix <
        /a> <
        /header> <
        /div>
    );
}



export default App;
